import React from 'react';

const Header = () => {
  return (
    <div className='header'>
      <div className='header__left'>
        <div className='header__button-box'>
          <a className='btn-primary'>自界</a>
          <a className='btn-primary btn-primary--2'>筆記</a>
        </div>
        <div className='header__text-box'>
          <h1 className='heading-primary'>
            <span className='heading-primary--main '>barrystone</span>
            <span className='heading-primary--sub'>Learning and making</span>
          </h1>
        </div>
        <div className='header__link-box'>
          <a className=' btn-secondary'>github</a>
        </div>
        <div className='menu'> </div>
      </div>
    </div>
  );
};

export default Header;
